import React, { useState, useEffect } from 'react';
// Importa axios si decides usarlo
// import axios from 'axios';

const TuComponente: React.FC = () => {
  const [chuckNorrisData, setChuckNorrisData] = useState<any>(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Utilizando fetch
        const response = await fetch('URL_DE_TU_API');
        const data = await response.json();


        setChuckNorrisData(data);
      } catch (error) {
        console.error('Error al obtener los datos:', error);
      }
    };

    fetchData();
  }, []); // El array vacío asegura que useEffect se ejecute solo una vez al montar el componente

  return (
    <div>
      {chuckNorrisData && (
        <div>
          <img src={chuckNorrisData.icon_url} alt="Chuck Norris" />
          <p>{chuckNorrisData.value}</p>
        </div>
      )}
    </div>
  );
};

export default TuComponente;
